'use strict';

const BaseClientFactory = require('./baseClientFactory');

class AWSS3ClientFactory extends BaseClientFactory {
    constructor() {
        super();
    }

    build(name) {
        const { S3 } = require('@tenna-llc/aws-sdk-wrapper');

        return new S3(super.get(name));
    }
}

module.exports = AWSS3ClientFactory;
